import React,{Component} from 'react'
import WishComponent from './WishComponent'
class WishesComponent extends Component{
    
    
    
    render() {
        return (
            <div >
                {
                    this.props.wishes.map((wish) => {
                          wish.id
                    })
                }
            </div>
        )
    }

}

export default WishesComponent
